import React from 'react';
import '../../styles/hover.css';
import computer from '../../images/computer.avif'

const styles = {
  image: {
    width: '80%',
    margin: '25px',
  },
  text: {
    position: 'absolute',
    bottom: '8px',
    left: '16px',
  }
}

export default function Portfolio() {
  return (
    <div class="container">
      <div class="row">
        <div class="col">
          <a href='https://github.com/EricKim86/disney-character-locator' target="blank"><img style={styles.image} src={computer} alt='profile' /></a></div>
        <div class="col">
          <img style={styles.image} src={computer} alt='profile' />
          <a href="#" class="btn btn-primary">Go somewhere</a>
          <a href="#" class="btn btn-primary">Go somewhere</a>
        </div>
        <div class="w-100"></div>
        <div class="col"><img style={styles.image} src={computer} alt='profile' /></div>
        <div class="col"><img style={styles.image} src={computer} alt='profile' /></div>
        <div class="w-100"></div>
        <div class="col"><img style={styles.image} src={computer} alt='profile' /></div>
        <div class="col"><img style={styles.image} src={computer} alt='profile' /></div>
      </div>
    </div>

  );
}
